@kevinreiss @carolyncole , @mzelesky is looking for examples but we have found examples that you can't see the difference in the display between production and staging. 
The example records that will show a difference in the display are constituent records with more than one 773s ; the 773s should have holdings and not suppressed (holdings). 
So far the most representative example is the one in the PR https://catalog-staging.princeton.edu/catalog/9923427953506421.
